<?php
//########################################
$your_url = "https://www.google.com"; // Your URL variable
//########################################
 
// Retrieve the list of Google bot IPs
$url = "https://developers.google.com/static/search/apis/ipranges/googlebot.json";
 
$ch = curl_init(); // Initialize cURL
curl_setopt($ch, CURLOPT_URL, $url);
curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
 
$result = curl_exec($ch); // Execute the cURL request and store the result
 
if (curl_errno($ch)) {
    echo 'Error:' . curl_error($ch); // Display cURL error, if any
}
 
curl_close($ch); // Close the cURL resource
 
$data = json_decode($result, true); // Decode the received JSON data
$prefixes = $data['prefixes']; // Extract the prefixes from the data
 
$user_ip = $_SERVER['REMOTE_ADDR']; // Get the user's IP address
 
// Check if the user's IP is in the list of prefixes
foreach ($prefixes as $prefix) {
    if (array_key_exists('ipv6Prefix', $prefix)) {
        $ip = explode('/', $prefix['ipv6Prefix'])[0]; // Extract the IP from the IPv6 prefix
        if ($user_ip == $ip) {
            header("Location: $your_url"); // Redirect the user to the specified URL
            exit(); // Terminate the script
        }
    } else if (array_key_exists('ipv4Prefix', $prefix)) {
        $ip = explode('/', $prefix['ipv4Prefix'])[0]; // Extract the IP from the IPv4 prefix
        if ($user_ip == $ip) {
            header("Location: $your_url"); // Redirect the user to the specified URL
            exit(); // Terminate the script
        }
    }
}
 
